 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "sublocationState": {
            "initialValues": {
                "secondaryActiveTabId": ""
            },
            "meta": {}
        },
        "selectionData": {
            "initialValues": {},
            "meta": {}
        }
    },
    "props": {
        "sub-panel-context": {
            "type": "object"
        },
        "base-selection": {
            "type": "object"
        },
        "selection-model": {
            "type": "object"
        },
        "selection-data": {
            "type": "object"
        }
    },
    "actions": {
        "handleSelectionChange": {
            "actionType": "JSFunction",
            "method": "handleSelectionChange",
            "inputData": {
                "localSelectionData": "{{data.selectionData}}",
                "parentSelectionData": "{{props.selectionData}}",
                "selectionQueryParamKey": "{{props.subPanelContext.selectionQueryParamKey}}"
            },
            "deps": "js/awDefaultSublocationService"
        },
        "syncSelectionAndExecuteUrlCommand": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "syncSelectionWithUrl",
                    "condition": "!props.selectionData"
                },
                {
                    "action": "executeUrlCommand"
                }
            ]
        },
        "syncSelectionWithUrl": {
            "actionType": "JSFunction",
            "method": "updateSelection",
            "inputData": {
                "selectionModel": "{{selectionModels.defaultSelectionModel}}",
                "parentSelectionModel": "{{props.selectionModel}}",
                "selectionQueryParamKey": "{{props.subPanelContext.selectionQueryParamKey}}",
                "originalParams": "{{data.changedParams}}"
            },
            "outputData": {
                "changedParams": "changedParams"
            },
            "deps": "js/awDefaultSublocationService"
        },
        "executeUrlCommand": {
            "actionType": "JSFunction",
            "method": "executeUrlCommand",
            "inputData": {
                "cmdContext": "{{props.subPanelContext}}",
                "cmdActionExe": "{{parameters.commandActionExecutor}}"
            },
            "deps": "js/urlArgsUtilsService"
        }
    },
    "lifecycleHooks": {
        "onMount": "syncSelectionAndExecuteUrlCommand",
        "onUpdate": [
            {
                "action": "handleSelectionChange",
                "observers": [
                    "viewModel.atomicData.selectionData"
                ]
            }
        ]
    },
    "onEvent": [
        {
            "eventId": "stateChangeSuccess",
            "action": "syncSelectionAndExecuteUrlCommand"
        }
    ],
    "selectionModels": {
        "defaultSelectionModel": {
            "selectionMode": "{{subPanelContext.selectionMode || 'multiple' }}"
        }
    },
    "_viewModelId": "AwDefaultSublocation",
    "_uniqueViewModelId": "AwDefaultSublocation",
    "ctx": {}
};

/*
<aw-default-sublocation-internal sub-panel-context="props.subPanelContext" sublocation-state="data.sublocationState" base-selection="props.baseSelection"
    selection-model="props.selectionModel || props.viewModel.selectionModels.defaultSelectionModel" selection-data="data.selectionData"></aw-default-sublocation-internal>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <AwDefaultSublocationInternal subPanelContext={AwParseService.instance( "props.subPanelContext" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} sublocationState={AwParseService.instance( "fields.sublocationState" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} baseSelection={AwParseService.instance( "props.baseSelection" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} selectionModel={AwParseService.instance( "props.selectionModel || props.viewModel.selectionModels.defaultSelectionModel" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} selectionData={AwParseService.instance( "fields.selectionData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
    </AwDefaultSublocationInternal>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
